import { observer } from "mobx-react-lite";
import NavBar from "./NavBar";

export const HomePage = observer(() => {
  return (
    <section className="w-[10vw] h-[50vw] bg-gradient-to-b from-[#70A9FF] via-[#316EC9] to-[#0149B4] text-[24px] font-bold text-white">
      <NavBar />
      <h1>Home page</h1>
    </section>
  );
});
